//stan hu tao//join nct ridin by first year culture repsimport static java.lang.Math.max;import static java.lang.Math.min;import static java.lang.Math.abs;import static java.lang.System.out;import java.util.*;import java.io.*;import java.math.*;Â public class x903B{    public static void main(String hi[]) throws Exception    {        BufferedReader infile = new BufferedReader(new InputStreamReader(System.in));        StringTokenizer st = new StringTokenizer(infile.readLine());        int H = Integer.parseInt(st.nextToken());        int A = Integer.parseInt(st.nextToken());        int P = Integer.parseInt(st.nextToken());        st = new StringTokenizer(infile.readLine());        int X = Integer.parseInt(st.nextToken());        int Y = Integer.parseInt(st.nextToken());        ArrayList<String> ls = new ArrayList<String>();        while(true)        {            if(X <= A)            {                ls.add("STRIKE");                break;            }            if(H > Y)            {                ls.add("STRIKE");                H -= Y;                X -= A;            }            else            {                ls.add("HEAL");                H -= Y;                H += P;            }        }        StringBuilder sb = new StringBuilder(ls.size()+"\n");        for(String s: ls)            sb.append(s+"\n");        System.out.print(sb);    }    public static int[] readArr(int N, BufferedReader infile, StringTokenizer st) throws Exception    {        int[] arr = new int[N];        st = new StringTokenizer(infile.readLine());        for(int i=0; i < N; i++)            arr[i] = Integer.parseInt(st.nextToken());        return arr;    }}
